function getHoursByTwoDate(date1, date2) {
  const dateOne = new Date(date1);
  const dateTwo = new Date(date2);
  const ms = dateTwo.getTime() - dateOne.getTime();
  if (ms < 0) {
    return 0;
  }
  return (ms / 1000 / 60 / 60).toFixed(2);
}
