function describingCircle(map, center, radius, isShowAllCircle, circleObj) {
  let {
    fillColor,
    fillOpacity,
    strokeColor,
    strokeWidth
  } = circleObj;
  let sourcePoint = new CTMapOl.source.Vector();
  let layerPoint = new CTMapOl.layer.Vector({
    // zIndex: 1,
    opacity: fillOpacity
  });
  layerPoint.setSource(sourcePoint);
  const geom = circular(center, radius);
  geom.transform('EPSG:4326', 'EPSG:3857');
  let feature = new CTMapOl.Feature({
    title: 'circle',
    geometry: geom
  });
  feature.setStyle(new CTMapOl.style.Style({
    fill: new CTMapOl.style.Fill({
      color: fillColor
    }),
    stroke: new CTMapOl.style.Stroke({
      color: strokeColor,
      width: strokeWidth
    })
  }));
  sourcePoint.addFeatures([feature]);
  map.addLayer(layerPoint);
  if (isShowAllCircle) {
    // 
    setTimeout(() => {
      map.getView().fit(geom, {
        padding: [50, 50, 50, 50]
      }); //
    }, 500);
  }
  return {
    feature: feature,
    sourcePoint: sourcePoint,
    layerPoint: layerPoint
  };
}

