/**
 * 
 * @param map 
 * @param center [lng,lat]
 * @param radius /
 * @param isShowAllCircle 
 * @param circleObj fillColorfillOpacitystrokeColorstrokeWidth
 */
function CommonCtMapOl_describingCircle(map, center, radius, isShowAllCircle, circleObj) {
  // 
  let coordinate = CommonCtMapOl_transCoordinate(center);
  let {
    fillColor,
    fillOpacity,
    strokeColor,
    strokeWidth
  } = circleObj;
  let sourcePoint = new VectorSource(); // 
  let layerPoint = new VectorLayer({
    // 
    zIndex: 1,
    // 
    opacity: fillOpacity
  });
  layerPoint.setSource(sourcePoint); // 
  let feature = new Feature({
    title: 'beijing',
    geometry: new CommonCtMapOl_circular(coordinate, radius)
  });
  feature.setStyle(new Style({
    fill: new Fill({
      color: fillColor
    }),
    stroke: new CTMapOl.style.Stroke({
      color: strokeColor,
      width: strokeWidth
    })
  }));
  sourcePoint.addFeatures([feature]);
  map.addLayer(layerPoint); // 
  if (isShowAllCircle) {
    //
    setTimeout(() => {
      map.getView().fit(new CommonCtMapOl_circular(coordinate, radius), {
        padding: [50, 50, 50, 50]
      }); //
    }, 500);
  }
  return {
    feature: feature,
    sourcePoint: sourcePoint,
    layerPoint: layerPoint
  };
}

/**
 * 
 * @param map 
 * @param circleObj 
 */
function CommonCtMapOl_clearCircle(map, circleObj) {
  circleObj.sourcePoint.removeFeature([circleObj.feature]);
  map.removeLayer(circleObj.layerPoint); //
}

/**
 * 
 * @param map 
 * @param lineArr 
 * @param strokeColor 
 * @param strokeWidth 
 * @param isShowAllPolyline 
 * @param isShowMarker 
 */
function CommonCtMapOl_describingPolyline(map, lineArr, strokeColor, strokeWidth, isShowAllPolyline, isShowMarker) {
  if (lineArr.length === 0) {
    return false;
  }
  // 
  let coordinates = transCoordinates(lineArr);
  let routeFeature = new CTMapOl.Feature({
    type: 'route',
    geometry: new CTMapOl.geom.LineString(coordinates)
  });
  // 
  const startMarker = new CTMapOl.Feature({
    type: 'startMarker',
    geometry: new CTMapOl.geom.Point(coordinates[0])
  });
  // 
  const endMarker = new CTMapOl.Feature({
    type: 'endMarker',
    geometry: new CTMapOl.geom.Point(coordinates[coordinates.length - 1])
  });
  // 
  let styles = {
    route: new CTMapOl.style.Style({
      stroke: new CTMapOl.style.Stroke({
        width: strokeWidth,
        //
        color: strokeColor //
      })
    }),
    //  geoMarker 
    startMarker: new CTMapOl.style.Style({
      image: new CTMapOl.style.Icon({
        src: __webpack_require__(6752),
        anchor: [0.5, 1.1] // 
      })
    }),
    endMarker: new CTMapOl.style.Style({
      image: new CTMapOl.style.Icon({
        src: __webpack_require__(9115),
        anchor: [0.5, 1.1] // 
      })
    })
  };
  let source = new CTMapOl.source.Vector({
    features: [routeFeature]
  });
  if (isShowMarker) {
    //
    source.addFeature(startMarker);
    source.addFeature(endMarker);
  }
  // 
  let vectorLayer = new CTMapOl.layer.Vector({
    source: source,
    //,,
    style: function (feature) {
      return styles[feature.get('type')];
    }
  });
  map.addLayer(vectorLayer);
  if (isShowAllPolyline) {
    //
    map.getView().fit(new CTMapOl.geom.LineString(coordinates), {
      padding: [100, 100, 100, 100],
      callback: map.getLayers().getArray()[1].dispatchEvent('postcompose')
    }); //
  }
  return {
    feature: routeFeature,
    vectorLayer: vectorLayer
  };
}

