/**
 * 
 */
class CommonCtMapOl_measureClass {
  constructor(map, color = '#ff0000') {
    this.map = map;
    this.color = color;
    this.measure = null;
  }

  /**
   * 
   * @param color
   */
  setColor(color) {
    this.color = color;
  }

  /**
   *  || 
   * @param type  || 
   */
  startMeasure(type = '') {
    this.distoryMeasure();
    this.measure = new CTMapOl.extend.ToolMeasure(this.map, {
      color: this.color,
      type: type
    });
    this.measure.start();
  }

  /**
   * 
   */
  clearMeasure() {
    if (this.measure) {
      this.measure.clear();
    }
  }

  /**
   * 
   */
  distoryMeasure() {
    if (this.measure) {
      this.measure.destroy();
      this.measure = null;
    }
  }
}

/**
 * 
 * @param coordArr  
 * @returns {number[]} 
 */
function CommonCtMapOl_getPolygonCenter(coordArr) {
  let x = 0;
  let y = 0;
  let len = coordArr.length;
  coordArr.forEach(item => {
    x += item[0];
    y += item[1];
  });
  return [x / len, y / len];
}

/**
 * 
 * @param coordArr 
 * @return {{lengthArr: *[], sum: *}}
 */
function CommonCtMapOl_getLineStringLength(coordArr) {
  let lengthArr = [];
  // 
  let coordinates = transCoordinates(coordArr);
  for (let i = 0; i < coordinates.length - 1; i++) {
    let line = new CTMapOl.geom.LineString([coordinates[i], coordinates[i + 1]]);
    let length = getLength(line, {
      projection: 'EPSG:3857'
    });
    lengthArr.push(length);
  }
  let sum = lengthArr.reduce((total, num) => {
    return total + num;
  }, 0);
  return {
    lengthArr,
    sum
  };
}

/**
 * 
 * @param coordArr  
 * @return {number}
 */
function CommonCtMapOl_getPolygonArea(coordArr) {
  // 
  let coordinates = transCoordinates(coordArr);
  let polygon = new CTMapOl.geom.Polygon(coordinates);
  let area = getArea(polygon, {
    projection: 'EPSG:3857'
  });
  return area;
}

