function CommonCtMapOl_showTextPolygonId(map, polygonId, path, textHtml, popClass, offsetX, offsetY, epsg = '3857') {
  let x = 0;
  let y = 0;
  let len = path.length;
  path.forEach(item => {
    x += Number(item[0]);
    y += Number(item[1]);
  });
  let position = [x / len, y / len];
  if (epsg == '4326') {
    position = CTMapOl.extend.formatLayer.transCooordinateToOpenlayer(position);
  }
  const overlayHtml = textHtml ? textHtml : `
  <div style=" height: 26px;
    line-height: 26px;
    border-radius: 13px;
    color: #fff;
    padding: 0 8px;
    font-size: 16px;
    position: relative;
    margin: 0 0 19px 6px;
    transform: translateX(50%);
    background: linear-gradient(121deg, #E91D18 0%, #BA261F 100%);
    box-shadow: 0 2px 4px 0 rgba(0, 0, 0, 0.2);" >
  <div style="
    width: 10px;
    height: 10px;
    border-radius: 50%;
    background: #E41E19;
    position: absolute;
    right: 100%;
    top: 50%;
    transform: translate(4px, -50%);"></div>
  ${polygonId}
  <div style="
    width: 4px;
    height: 32px;
    background: #E41E19;
    position: absolute;
    right: 100%;
    top: 50%;"></div>
  </div>`;
  let infoWindow;
  const infoWindowId = 'infoWindowId';
  let $info;
  $info = document.createElement('div');
  $info.id = infoWindowId;
  $info.className = popClass;
  $info.innerHTML = overlayHtml;
  $info.onmousewheel = function (e) {
    e.stopPropagation();
  };
  $info.onclick = function (e) {
    e.stopPropagation();
  };
  document.body.appendChild($info);
  /**
   * Create an overlay to anchor the popup to the map.
   */
  infoWindow = new CTMapOl.Overlay({
    id: infoWindowId,
    element: $info,
    position: position,
    positioning: 'bottom-center',
    //
    stopEvent: false,
    //
    offset: [offsetX, offsetY],
    autoClose: false,
    // false
    pointerEvents: 'auto',
    // pointer-eventsauto
    autoPan: {
      animation: {
        duration: 250
      }
    }
  });
  infoWindow.on('click', function (event) {
    event.stopPropagation();
    // 
  });
  map.addOverlay(infoWindow);
  return infoWindow;
}

