/**
 * @description  : polygon
 * @param         { Object } map 
 * @param         { Array } coordinates 
 * @param         { Object } styleObject { strokeColor,strokeWidth,fillColor,fillOpacity } 
 * @param         { Object } nodeStyleObject { nodeRadius,nodeColor } 
 * @param         { Boolean } isShowAllPolygon 
 * @param         { String }id id
 */
function CommonCtMapOl_renderPolygon(map, coordinates, styleObject, nodeStyleObject, isShowAllPolygon, id) {
  const {
    strokeColor,
    strokeWidth,
    fillColor,
    fillOpacity
  } = styleObject;
  const {
    nodeRadius,
    nodeColor
  } = nodeStyleObject;
  if (coordinates.length === 0) {
    return false;
  }
  let _coordinates = CommonCtMapOl_transCoordinate(coordinates);
  let styles = [];
  // 
  if (styleObject) {
    let style = new CTMapOl.style.Style({
      stroke: new CTMapOl.style.Stroke({
        color: strokeColor ? strokeColor : 'blue',
        width: strokeWidth ? strokeWidth : 3
      }),
      fill: new CTMapOl.style.Fill({
        color: fillColor ? fillColor : 'rgba(0, 0, 255, 0.1)'
      })
    });
    styles.push(style);
  }
  // 
  if (nodeStyleObject) {
    let nodeStyle = new CTMapOl.style.Style({
      image: new CommonCtMapOl_CircleStyle({
        radius: nodeRadius ? nodeRadius : 0,
        fill: new CTMapOl.style.Fill({
          color: nodeColor ? nodeColor : 'orange'
        })
      }),
      geometry: function (_feature) {
        // const coordinates = ;
        return new CTMapOl.geom.MultiPoint(_feature.getGeometry().getCoordinates()[0]);
      }
    });
    styles.push(nodeStyle);
  }
  const polygonFeature = new CTMapOl.geom.Polygon([_coordinates]);
  let feature = new CTMapOl.Feature({
    geometry: polygonFeature,
    id: id
  });
  let vectorSource = new CTMapOl.source.Vector();
  vectorSource.addFeature(feature);
  let vectorLayer = new CTMapOl.layer.Vector({
    source: vectorSource,
    style: styles,
    opacity: fillOpacity ? fillOpacity : 1
  });
  map.addLayer(vectorLayer);
  // 
  if (isShowAllPolygon) {
    map.getView().fit(new CTMapOl.geom.Polygon(_coordinates), {
      padding: [100, 100, 100, 100]
    });
  }
  return {
    feature: feature,
    polygonFeature: polygonFeature,
    vectorLayer: vectorLayer
  };
}

