/**
 * @description  : 
 * @param         { Object } map 
 * @param         { Object } type 
 * @param         { Array } coordinates 
 * @param         { Object } styleObject { strokeColor,strokeWidth,fillColor } 
 * @param         { boolean } flag 
 * @param         { number } zIndex 
 */
function renderGraphic(map, type = 'Point', coordinates, styleObject, flag, zIndex = 0, color = '#000') {
  if (coordinates.length === 0) {
    return false;
  }
  // 
  coordinates = transCoordinates(coordinates);
  let tempCoordinates = [coordinates];
  const image = new CommonCtMapOl_CircleStyle({
    radius: 5,
    fill: null,
    stroke: new Stroke({
      color: 'red',
      width: 1
    })
  });
  let stroke = new Stroke({
    color: styleObject.strokeColor ? styleObject.strokeColor : 'blue',
    width: styleObject.strokeWidth ? styleObject.strokeWidth : 3
  });
  let fill = new Fill({
    color: styleObject.fillColor ? styleObject.fillColor : 'rgba(0, 0, 255, 0.1)'
  });
  const polygonStyle = _feature => {
    let text = _feature.get('text');
    return new Style({
      stroke: stroke,
      fill: fill,
      text: text ? new Text({
        font: '14px sans-serif',
        overflow: true,
        fill: new Fill({
          color: color
        }),
        stroke: new Stroke({
          width: 0.5,
          color: color
        }),
        text
      }) : undefined
    });
  };
  const styles = {
    Point: new Style({
      image: image
    }),
    LineString: new Style({
      stroke: stroke
    }),
    Polygon: polygonStyle,
    MultiPolygon: polygonStyle,
    Circle: new Style({
      stroke: stroke,
      fill: fill
    })
  };
  const styleFunction = function (_feature) {
    const style = styles[_feature.getGeometry().getType()];
    return typeof style === 'function' ? style(_feature) : style;
  };
  const crs = {
    type: 'name',
    properties: {
      name: 'EPSG:3857'
    }
  };
  let geojsonObject = {
    type: 'FeatureCollection',
    crs: crs,
    features: []
  };
  let feature = {
    type: 'Feature',
    geometry: {}
  };
  let geometry;
  switch (type) {
    case 'Point':
      {
        geometry = {
          type: 'Point',
          coordinates: coordinates[0]
        };
        break;
      }
    case 'Polyline':
      {
        geometry = {
          type: 'LineString',
          coordinates: coordinates
        };
        break;
      }
    case 'Polygon':
      {
        geometry = {
          type: 'Polygon',
          coordinates: tempCoordinates
        };
        break;
      }
    case 'MultiPolygon':
      {
        geometry = {
          type: 'MultiPolygon',
          coordinates: [tempCoordinates]
        };
        break;
      }
    case 'Circle':
      {
        geometry = {
          type: 'Polygon',
          coordinates: tempCoordinates
        };
        break;
      }
  }
  feature.geometry = geometry;
  geojsonObject.features.push(feature);
  const olFeatures = new GeoJSON().readFeatures(geojsonObject);
  const vectorSource = new VectorSource({
    features: olFeatures
  });
  const vectorLayer = new VectorLayer({
    source: vectorSource,
    style: styleFunction,
    zIndex: zIndex
  });
  map.addLayer(vectorLayer);
  if (flag) {
    setTimeout(() => {
      map.getView().fit(new CTMapOl.geom.Polygon(tempCoordinates), {
        padding: [100, 100, 100, 100]
      });
    }, 500);
  }
  return {
    feature: geojsonObject,
    polygonFeature: olFeatures[0],
    vectorSource: vectorSource,
    vectorLayer: vectorLayer
  };
}

/**
 * @description  : 
 * @param         { Object } map 
 * @param         { Array } coordinates 
 * @param         { Object } styleObject { strokeColor,strokeWidth,fillColor } 
 * @param         { String } gridName 
 * @param         { Boolean } flag 
 */
function CommonCtMapOl_setPolygon(map, coordinates, styleObject, gridName, flag) {
  let fillColor = styleObject.fillColor;
  let strokeColor = styleObject.strokeColor;
  let polygonStyle = new CTMapOl.style.Style({
    fill: new CTMapOl.style.Fill({
      color: fillColor
    }),
    stroke: new CTMapOl.style.Stroke({
      color: strokeColor,
      width: styleObject.strokeWidth ? styleObject.strokeWidth : 3
    })
  });
  if (!flag) {
    polygonStyle.setText(new CTMapOl.style.Text({
      text: gridName,
      fill: new CTMapOl.style.Fill({
        color: '#333'
      }),
      textAlign: 'center'
    }));
  }
  // 
  let tempCoordinates = transCoordinates(coordinates);
  let polygon = new CTMapOl.geom.Polygon(tempCoordinates);
  let featureVV = new CTMapOl.Feature({
    geometry: polygon,
    type: 'polygon'
  });
  featureVV.setStyle(polygonStyle);
  let polygonSource = new VectorSource(); // 
  let polygonLayer = new VectorLayer({
    // 
    zIndex: 9999 // 
  });
  polygonLayer.setSource(polygonSource); // 
  polygonSource.addFeature(featureVV);
  map.addLayer(polygonLayer); // 
  return {
    polygon,
    featureVV,
    polygonLayer
  };
}

