const DEFAULTCESIUMSTYLE = {
  Point: {
    strokeColor: 'red',
    strokeWeight: 2,
    strokeOpacity: 0.5,
    fillOpacity: 1,
    fillColor: 'green'
  },
  Polyline: {
    strokeColor: 'blue',
    strokeOpacity: 0.8,
    strokeWeight: 1
  },
  Polygon: {
    fillColor: 'rgba(0, 0, 255, 0.1)',
    fillOpacity: 0.5,
    strokeColor: 'blue',
    strokeOpacity: 1,
    strokeWeight: 11
  },
  CirCle: {
    strokeColor: 'red',
    strokeWeight: 2,
    strokeOpacity: 0.5,
    fillOpacity: 1,
    fillColor: 'green'
  }
};
function defaultStyleObject(type, styleObject = {}) {
  const obj = DEFAULTCESIUMSTYLE[type];
  if (obj) {
    Object.keys(obj).forEach(k => {
      // styleObjectkeynull
      if (!styleObject?.[k]) {
        styleObject[k] = obj[k];
      }
    });
  }
  return styleObject;
}
/**
 * @description  : 3D
 * @param         { Object } map 
 * @param         { Object } type 
 * @param         { Array } coordinates 
 * @param         { String } radius 
 * @param         { Object } styleObject { strokeColor,strokeWeight,strokeOpacity,fillColor,fillOpacity } 
 * @param         { boolean } flag 
 */
function renderCesiumPolygon(map, type = 'Point', coordinates, radius = '500',
// 
styleObject, flag) {
  if (coordinates.length === 0) {
    return false;
  }
  let options;
  let polygon;
  switch (type) {
    case 'Point':
      {
        options = {
          center: coordinates[0],
          radius: Number(radius),
          ...defaultStyleObject(type, styleObject),
          zIndex: 50,
          bubble: true,
          zoomto: flag // 
        };
        polygon = new CTMapOl.cesiumComponent.Circle(options);
        polygon.addTo({
          viewer: map
        });
        break;
      }
    case 'Polyline':
      {
        options = {
          path: coordinates,
          //  [116.43, 55.92, 100]
          zoomto: flag,
          ...defaultStyleObject(type, styleObject)
        };
        polygon = new CTMapOl.cesiumComponent.Polyline(options);
        polygon.addTo({
          viewer: map
        });
        break;
      }
    case 'Polygon':
      {
        options = {
          path: [coordinates],
          zoomto: flag,
          ...defaultStyleObject(type, styleObject)
        };
        polygon = new CTMapOl.cesiumComponent.Polygon(options);
        polygon.addTo({
          viewer: map
        });
        break;
      }
    case 'Circle':
      {
        options = {
          center: coordinates[0],
          radius: Number(radius),
          ...defaultStyleObject(type, styleObject),
          zIndex: 50,
          bubble: true,
          zoomto: flag // 
        };
        polygon = new CTMapOl.cesiumComponent.Circle(options);
        polygon.addTo({
          viewer: map
        });
        break;
      }
  }
  return polygon;
}

