  /**
   * 
   */
  static formatClusterList(list, attrObj, iconObj, mapId) {
    const {
      longitudeAttr,
      latitudeAttr,
      idAttr
    } = attrObj;
    const {
      imgPath,
      pointImgWidth,
      pointImgHeight,
      iconOffset
    } = iconObj;
    let returnList = [];
    for (const item of list) {
      const longitude = item[longitudeAttr];
      const latitude = item[latitudeAttr];
      const id = item[idAttr];
      let idStr = id;
      if (!(longitude && latitude && id)) {
        continue;
      }
      const icon = attrObj.iconAttr != null ? item[attrObj.iconAttr] || imgPath : imgPath;
      const clickIcon = attrObj.clickIconAttr != null ? item[attrObj.clickIconAttr] : icon;
      let param;
      if (this.is3d(mapId)) {
        //
        param = {
          weight: 8,
          icon: icon,
          iconSize: [pointImgWidth, pointImgHeight],
          offset: iconOffset,
          iconOffset: iconOffset,
          clickIcon: clickIcon,
          clickBig: false,
          arFlag: item.arFlag,
          onlineFlag: item.onlineFlag
        };
        if (attrObj.clickable != null) {
          param.clickable = attrObj.clickable;
        }
        param.id = idStr;
        param.lnglat = [Number(longitude), Number(latitude)];
      } else {
        param = {
          id: idStr,
          longitude: Number(longitude),
          latitude: Number(latitude),
          iconSize: [pointImgWidth, pointImgHeight],
          icon: icon,
          clickIcon: clickIcon,
          offset: iconOffset,
          arFlag: item.arFlag,
          onlineFlag: item.onlineFlag
        };
      }
      returnList.push(param);
    }
    return returnList;
  }

