  /**
   * 
   * @param eventName 
   * @param fn  lnglat, height
   * @param mapId
   */
  static pickMapCoor(eventName, fn, mapId) {
    let map = this.getMap(mapId);
    if (this.is3d(mapId)) {
      this.startPick(fn);
    } else {
      if (eventName === 'click') {
        const _this = this;
        let clickHandler = function (evt) {
          let lngLat = evt.coordinate;
          map.un('click', clickHandler);
          _this.executeFunction(fn, {
            lng: lngLat[0],
            lat: lngLat[1]
          });
        };
        map.on('click', clickHandler);
      }
    }
  }
