  /**
   * 
   *  layerId id
   *  list [{list: [],},{list: [],},{list: [],}]
   */
  static TT3DshowPoints(layerId, list, mapId) {
    if (!this.is3d(mapId)) {
      return;
    }
    const map = this.getMap(mapId);
    const massMarks = [];
    // 
    list.forEach((item, i) => {
      if (!item.list?.length) {
        return;
      }
      const pFlag = i < 2; // 

      let _points = [];
      let _offset = item.list[0].offset.join() || '24, 24';
      if (pFlag) {
        item.list.forEach(subitem => {
          if (subitem.count > 0) {
            _points.push([`${subitem.longitude},${subitem.latitude}`, subitem.id, subitem.icon, _offset, subitem.count]);
          }
        });
      } else {
        item.list.forEach(subitem => {
          _points.push([`${subitem.longitude},${subitem.latitude}`, subitem.id, subitem.icon, _offset]);
        });
      }
      const params = {
        layerId: layerId,
        points: _points,
        width: item.width,
        height: item.height,
        // clickOption: [{
        //   icon:  list[i].clickIcon,
        //   big: false,
        // }],
        clickBig: false,
        clickIcon: item.clickIcon,
        viewer: map,
        zoom: item.otherZoomMin,
        maxZoom: item.otherZoomMax,
        zIndex: item.zIndex || 0
        // zomm: 10,
      };
      if (pFlag) {
        params.remark = item.remark || {
          fontSize: 14,
          color: 'white',
          offset: [0, 10] // 
        };
      }
      const massMark = new CTMapOl.cesiumComponent.Points(params);
      massMark.addTo({
        viewer: map
      });
      massMarks.push(massMark);
    });
    return massMarks;
  }

